import React from 'react';
// import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (

      <div>
        <h1>REACT ROUTER</h1>
        <Route>
        <ul>
          <li>
            <a href="/">Home</a>
          </li>
          <li>
            <a href="/about">About</a>
          </li>
          <li>
            <a href="/Contact">CONTACT</a>
          </li>
        </ul>



        <Home />
        <About />
        <Contact />
        </Route>
        </div>

  );
}

function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Contact() {
  return <h2>CONTACT</h2>;
}



export default App;
